import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { AppBar, Toolbar, Typography, Button, Container, Box, CssBaseline } from '@mui/material';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { styled } from '@mui/material/styles';

// Import pages
import WeatherPage from './pages/WeatherPage';
import MapMarkersPage from './pages/MapMarkersPage';
import Page3 from './pages/Page3';
import Page4 from './pages/Page4';
import Page5 from './pages/Page5';

const theme = createTheme();

const StyledLink = styled(Link)`
  text-decoration: none;
  color: white;
`;

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Router>
        <Box sx={{ flexGrow: 1 }}>
          <AppBar position="static">
            <Toolbar>
              <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                Multi-Feature App
              </Typography>
              <Button color="inherit">
                <StyledLink to="/">Weather</StyledLink>
              </Button>
              <Button color="inherit">
                <StyledLink to="/map-markers">Map Markers</StyledLink>
              </Button>
              <Button color="inherit">
                <StyledLink to="/page3">Page 3</StyledLink>
              </Button>
              <Button color="inherit">
                <StyledLink to="/page4">Page 4</StyledLink>
              </Button>
              <Button color="inherit">
                <StyledLink to="/page5">Page 5</StyledLink>
              </Button>
            </Toolbar>
          </AppBar>

          <Container sx={{ mt: 4 }}>
            <Routes>
              <Route path="/" element={<WeatherPage />} />
              <Route path="/map-markers" element={<MapMarkersPage />} />
              <Route path="/page3" element={<Page3 />} />
              <Route path="/page4" element={<Page4 />} />
              <Route path="/page5" element={<Page5 />} />
            </Routes>
          </Container>
        </Box>
      </Router>
    </ThemeProvider>
  );
}

export default App;
